export default function makeFindMixin(options: any): {
    data(): {
        [x: string]: any;
    };
    computed: {
        [x: string]: () => any;
        [x: number]: () => any;
    };
    methods: {
        [x: string]: (params: any) => any;
        getPaginationForQuery(params?: {}): {
            queryInfo: any;
            pageInfo: any;
        };
    };
    created(): any;
};
